<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8" />
    <title>Aquarium</title>
    <style>
        * {
            box-sizing: border-box;
        }
        body {
            min-height: 100vh;
            width: 100%;
            padding: 0;
            margin: 0;
            overflow: hidden;
        }

        .container {
            position: relative;

            min-height: 100vh;
            min-width: 100%;

            background-image: linear-gradient(45deg, #82F4F4, #72E3FC);
        }

        @keyframes swimming {
            from {
                right: -10%;
                transform: translateY(0%);
            }

            25% {
                right: 25%;
                transform: translateY(30%);
            }

            50% {
                right: 50%;
                transform: translateY(0%);
            }

            75% {
                right: 75%;
                transform: translateY(50%);
            }

            to {
                right: 110%;
                transform: translateY(0%);
            }
        }

        @keyframes swimming-reverse {
            from {
                left: -10%;
                transform: translateY(10%);
            }

            25% {
                left: 25%;
                transform: translateY(50%);
            }

            50% {
                left: 50%;
                transform: translateY(0%);
            }

            75% {
                left: 75%;
                transform: translateY(20%);
            }

            to {
                left: 110%;
                transform: translateY(0%);
            }
        }

        @keyframes moving-tail {
            from {
                transform: rotateY(-30deg) translateZ(-20px);
            }

            50% {
                transform: rotateY(0deg) translateZ(0px);
            }

            to {
                transform: rotateY(30deg) translateZ(20px);
            }
        }

        @keyframes moving-flipper {
            from {
                transform: rotateX(20deg) rotateY(20deg);
            }

            50% {
                transform: rotateX(0deg) rotateY(0deg);
            }

            to {
                transform: rotateX(20deg) rotateY(20deg);
            }
        }

        @keyframes moving-mustache {
            from {
               transform: rotate3d(15, 1, 1, -10deg);
            }

            50% {
                transform: rotate3d(15, 1, 1, 10deg);
            }
            to {
                transform: rotate3d(15, 1, 1, -10deg);
            }
        }

        @keyframes moving-around {
            from {
                top: auto;
                left: auto;
                bottom: 0%;
                right: 0%;

                transform: rotate(0deg);
            }

            30% {
                top: auto;
                left: auto;
                bottom: 0%;
                right: 91%;

                transform: rotate(0deg);
            }

            31% {
                top: auto;
                left: 0%;
                bottom: 0%;
                right: auto;

                transform: rotate(90deg);
            }

            50% {
                top: auto;
                bottom: 85%;
                left: 0%;
                right: auto;

                transform: rotate(90deg);
            }

            51% {
                top: 0%;
                bottom: auto;
                left: 0%;
                right: auto;

                transform: rotate(180deg);
            }

            80% {
                top: 0%;
                bottom: auto;
                left: 85%;
                right: auto;

                transform: rotate(180deg);
            }

            81% {
                top: 0%;
                bottom: auto;
                left: auto;
                right: 0%;

                transform: rotate(270deg);
            }

            to {
                top: 85%;
                bottom: auto;
                left: auto;
                right: 0%;

                transform: rotate(270deg);
            }
        }

        @keyframes wind {
            from {
                transform: skewX(0deg);
            }

            25% {
                transform: skewX(-10deg) translateY(-26px) rotate(-30deg);
            }

            50% {
                transform: skewX(0deg);
            }

            75% {
                transform: skewX(10deg);
            }

            to {
                transform: skewX(0deg);
            }
        }

        @keyframes wind-smaller {
            from {
                transform: skewX(0deg);
            }

            25% {
                transform: skewX(10deg);
            }

            50% {
                transform: skewX(0deg);
            }

            75% {
                transform: skewX(10deg);
            }

            to {
                transform: skewX(0deg);
            }
        }

        .fish {
            position: absolute;
            width: 10%;
            z-index: 10;

            transform: translateY(0%);
        }

        .fish-orange {
            top: 10px;
            right: 0%;

            animation: swimming 5s linear infinite;
        }

        .fish-darkpirple {
            top: 100px;
            left: 10%;

            animation: swimming-reverse 6s linear infinite;
        }

        .fish__tail {
            transform: rotateY(0deg) translateZ(0px);
            animation: moving-tail 1s linear infinite;
        }

        .flipper-down-right {
            transform: rotateY(0deg);
            animation: moving-flipper 1.1s linear infinite;
        }

        .flipper-down-left {
            animation: moving-flipper 1.1s linear reverse infinite;
        }

        .mustache {
            transform: rotate3d(1, 1, 1, 0deg);
            animation: moving-mustache 1.5s linear infinite;
        }

        .snail {
            position: absolute;
            bottom: 0%;
            right: 0%;
            z-index: 1;

            width: 10%;

            animation: moving-around 10s linear infinite;
        }

        .grass {
            position: absolute;
            bottom: 20px;
        }

        .grass-left {
            left: 15%;

            width: 35%;
        }

        .grass-left .grass__leave {
            animation: wind 10s linear infinite;
        }

        .grass-right .grass__leave {
            animation: wind-smaller 15s linear infinite;
        }

        .grass__leave {
            transform-origin: center bottom;
        }

        .grass-right {
            right: 8%;

            width: 45%;
        }

        .bubbles {
            position: absolute;
            left: 0;
            top: 0;
            height: 100%;
            width: 100%;
            z-index: 15;
        }

        .bubble {
            stroke: #5CC6DE;
            fill: white;
            opacity: 0.5;
        }

        @keyframes up {
            from {
                cy: 140%;
            }
            to {
                cy: -40%;
            }
        }

        .bubble-1,
        .bubble-10 {
            animation: up 3s 1s linear infinite;
        }

        .bubble-2 {
            animation: up 5s ease-in-out infinite;
        }

        .bubble-3,
        .bubble-15 {
            animation: up 8s 2s linear infinite;
        }

        .bubble-4,
        .bubble-9 {
            animation: up 4s ease-out infinite;
        }

        .bubble-5,
        .bubble-12 {
            animation: up 3s 1s ease-in-out infinite;
        }

        .bubble-6 {
            animation: up 5s linear infinite;
        }

        .bubble-7,
        .bubble-11 {
            animation: up 9s linear infinite;
        }

        .bubble-8 {
            animation: up 3s 1s ease-in infinite;
        }

        .bubble-13 {
            animation: up 6s 1s ease-in infinite;
        }

        .bubble-14 {
            animation: up 5s linear infinite;
        }
    </style>
</head>
